import React,{Component} from 'react';
import Slider from 'react-slick';

const Slider1 = () => {

  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    autoplay:true,
    autoplayspeed:200,
    slidesToShow: 1,
    slidesToScroll: 1
  };
  return(
      <div>
           <div>
      
        <Slider {...settings}>
          <div>
            <h3>1</h3>
          </div>
          <div>
            <h3>2</h3>
          </div>
          <div>
            <h3>3</h3>
          </div>
          <div>
            <h3>4</h3>
          </div>
          <div>
            <h3>5</h3>
          </div>
          <div>
            <h3>6</h3>
          </div>
        </Slider>
      </div>
      </div>
  );
};

export default Slider1;
